    public List<Sucursal> sucursales { get; set; } = new List<Sucursal>();
    public Sucursal sucursal { get; set; } = new Sucursal();

    protected override async Task OnInitializedAsync()
    {
        var authState = await AuthenticationStateProvider.GetAuthenticationStateAsync();
        sucursales = await http.GetJsonAsync<List<Sucursal>>($"/api/Cuentas/UserSucursal/{authState.User.Identity.Name}");
    }

    protected async Task ChangeSucursal(ChangeEventArgs e, string userName)
    {
        sucursal = sucursales.Where(x => x.SucursalId == Convert.ToInt32(e.Value.ToString())).First();
        await http.PostJsonAsync<UserEntradas>("/api/Cuentas/cambiarSucusal", new UserEntradas { sucursal = sucursal, userName = userName });
        VariablesGlobales.sucursal = sucursal;
        Console.WriteLine(VariablesGlobales.sucursal.SucursalId);
        this.StateHasChanged();
        uriHelper.NavigateTo("/", false);
    }


